// App.js
import React from 'react';
import Navbar from './components/Navbar';
import News from './components/News_';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <News />
      </Router>
    </>
  );
}

export default App;
